 class TouchHandler{
    private _onTouchStart = new SimpleEventDispatcher<TouchData>();
    private _onFirstTouch = new SimpleEventDispatcher<TouchData>();
    private _onTouchEnd = new SimpleEventDispatcher<TouchData>();
    private _onLastTouch = new SimpleEventDispatcher<TouchData>();
    private _onTouchMove = new SimpleEventDispatcher<TouchData>();
    private _onPinchIn = new SimpleEventDispatcher<number>(); //zoom out
    private _onPinchOut = new SimpleEventDispatcher<number>(); // zoom in
    private _onSwipe = new SimpleEventDispatcher<Vector2>();

    private _touches = new Map<number, TouchData>();
    private _touchesCache = new Map<number, boolean>();
    private _touchIndexReferences = new Map<number, number>();

    private _firstTouch: boolean;

    private _pinchStartDistance: number;
    private _pinchPreviousDistance: number;

    private _swipeStartPoint: Vector2;
    private _swipePreviousPoint: Vector2;
    private _swipeDirection: Direction;
    private _swiping = false;
    private _swipeCounter: number;

    public get onTouchStartEvent(): SimpleEventDispatcher<TouchData>{
        return this._onTouchStart;
    }

    public get onTouchEndEvent(): SimpleEventDispatcher<TouchData>{
        return this._onTouchEnd;
    }

    public get onTouchMoveEvent(): SimpleEventDispatcher<TouchData>{
        return this._onTouchMove;
    }

    public get onLastTouchEvent(): SimpleEventDispatcher<TouchData>{
        return this._onLastTouch;
    }

    public get onFirstTouchEvent(): SimpleEventDispatcher<TouchData>{
        return this._onFirstTouch;
    }

    public get onPinchInEvent(): SimpleEventDispatcher<number>{
        return this._onPinchIn;
    }

    public get onPinchOutEvent(): SimpleEventDispatcher<number>{
        return this._onPinchOut;
    }

    public get onSwipeEvent(): SimpleEventDispatcher<Vector2>{
        return this._onSwipe;
    }

    constructor(){
        this._pinchPreviousDistance = -1;
        this._pinchStartDistance = 0;
        this._firstTouch = true;

        this._swipeStartPoint = new Vector2();
        this._swipePreviousPoint = new Vector2();
        this._swipeDirection = Direction.NONE;
        this._swipeDirection = 0;
        this._swipeCounter = 0;

        this.addEventListners();
    }

    public update(): void{
    }

    public lateUpdate():void {
        this._touchesCache.clear();
    }

    public isTouching():boolean {
        return this._touches.size > 0;
    }

    public getTouchCount(): number{
        return this._touches.size;
    }

    public getTouchList(){
        return _.cloneDeep(this._touches);
    }

    public getTouch(fingerId: number):boolean{
        return this._touches.has(fingerId);
    }

    public getTouchDown(fingerId: number):boolean{
        if(this._touchesCache.has(fingerId)){
            if(this._touchesCache.get(fingerId)){
                return true;
            }
        }
        return false;  
    }

    public getTouchUp(fingerId: number):boolean{
        if(this._touchesCache.has(fingerId)){
            if(!this._touchesCache.get(fingerId)){
                return true;
            }
        }

        return false;
    }

    public getTouchPosition(fingerId: number): Vector2 {
        if(this._touches.has(fingerId)){
            let touchPosistion = this._touches.get(fingerId)!.clientPosition;
            return touchPosistion;
        }
        return new Vector2();
    }

    private addEventListners(): void {
        document.addEventListener(
            "touchstart",
            function(this: TouchHandler ,event: TouchEvent) {
                this.doOnTouchStart(event);
            }.bind(this)
        );

        document.addEventListener(
            "touchend",
            function(this: TouchHandler, event: TouchEvent) {
                this.doOnTouchEnd(event);
            }.bind(this)
        );

        document.addEventListener(
            "touchmove",
            function(this: TouchHandler, event: TouchEvent) {
                this.doOnTouchMove(event);
            }.bind(this)
        );
    }

    private reformatIdentifier(originalIdentifier: number): number{
        if(this._touchIndexReferences.size == 0){
            this._touchIndexReferences.set(originalIdentifier, 0);
            return 0;
        }

        if(this._touchIndexReferences.size > 0){
            for(let i = 0; i < this._touchIndexReferences.size+1; i++){
                let exists = false;

                if(Array.from(this._touchIndexReferences.values()).includes(i)){
                    exists = true;
                }
                
                if(!exists){
                    this._touchIndexReferences.set(originalIdentifier, i);
                    return i;
                }
            }
        }
        return -1;
    }

    private doOnTouchStart(event: TouchEvent): void {
        for (let i = 0; i < event.changedTouches.length; i++) {   
            let identifier = this.reformatIdentifier(event.changedTouches[i].identifier);

            if(this._touches.has(identifier))
            return;

            let dataObject = this.createTouchDataObject(identifier ,event.changedTouches[i], event.type);

            this._touches.set(identifier ,dataObject)
            this._touchesCache.set(identifier, true);

            this._onTouchStart.dispatch(dataObject);    
            this.dispatchIfFirstTouch(dataObject);

            this._swipeStartPoint = dataObject.clientPosition;
            this._swipePreviousPoint = dataObject.clientPosition;
            this._swipeDirection = Direction.NONE;
            this._swipeCounter = 0;
        }  
    }

    private doOnTouchEnd(event: TouchEvent){
        for (let i = 0; i < event.changedTouches.length; i++) {
            if(!this._touchIndexReferences.has(event.changedTouches[i].identifier)){
                return;
            }
            let identifier = this._touchIndexReferences.get(event.changedTouches[i].identifier)!;
            //let identifier = event.changedTouches[i].identifier

            if(!this._touches.has(identifier))
