            let dataObject = this.createTouchDataObject(identifier, event.changedTouches[i], event.type);
            
            this._touches.delete(identifier);
            this._touchIndexReferences.delete(event.changedTouches[i].identifier);
            this._touchesCache.set(identifier, false);
                
            this._onTouchEnd.dispatch(dataObject);
            this.dispatchIfLastTouch(dataObject);

            this._pinchPreviousDistance = -1;
            this._pinchStartDistance = 0;

            this.handleSwipe(dataObject);
            this._swipePreviousPoint = new Vector2();
            this._swipeCounter = 0;
        }  
    }

    private handleSwipe(dataObject: TouchData){
        let swipeVector = dataObject.clientPosition.subtract(this._swipeStartPoint);        
        let resultVector = this.checkIfSwiping(swipeVector);
        if(!resultVector.equals(new Vector2())){
                this._onSwipe.dispatch(resultVector);
        }

        this._swipeDirection = Direction.NONE
        this._swiping = false
    }

    private doOnTouchMove(event: TouchEvent){
        for (let i = 0; i < event.changedTouches.length; i++) {
            if(!this._touchIndexReferences.has(event.changedTouches[i].identifier)){
                return;
            }
            
            let identifier = this._touchIndexReferences.get(event.changedTouches[i].identifier)!;

            let dataObject = this.createTouchDataObject(identifier, event.changedTouches[i], event.type);

            this._touches.set(dataObject.touchIdentifier, dataObject)
            this._onTouchMove.dispatch(dataObject); 

            if(this._swipeCounter == 5){
                let swipeVector = dataObject.clientPosition.subtract(this._swipePreviousPoint);
                this._swipePreviousPoint = dataObject.clientPosition;
                this.checkIfSwiping(swipeVector);
                this._swipeCounter = 0;
            }
            this._swipeCounter++
        }
        if(this._touches.size == 2){
            this.checkPinch();
        }
    }

    private checkIfSwiping(swipeVector: Vector2):Vector2{
        swipeVector = swipeVector.normalized();
        let roundedSwipeVector = _.cloneDeep(swipeVector);
        roundedSwipeVector.x = Math.round(swipeVector.x);
        roundedSwipeVector.y = Math.round(swipeVector.y);
        if(this._swipeDirection == Direction.NONE){
            if(roundedSwipeVector.equals(Vector2.left())){
