                this._swiping = true;
            }
            if(roundedSwipeVector.equals(new Vector2(-1, -1))){
                this._swipeDirection = Direction.LEFTUP;
                this._swiping = true;
            }
            if(roundedSwipeVector.equals(new Vector2(-1, 1))){
                this._swipeDirection = Direction.LEFTDOWN;
                this._swiping = true;
            }
            if(roundedSwipeVector.equals(new Vector2(1, -1))){
                this._swipeDirection = Direction.RIGHTUP;
                this._swiping = true;
            }
            if(roundedSwipeVector.equals(new Vector2(1, 1))){
