    private checkPinch(){

        let pinchCurrrentDifference: number;
        let touchPositions: Vector2[]= []

        this._touches.forEach(element => {
            touchPositions.push(element.clientPosition);          
        });

        pinchCurrrentDifference = Math.abs(touchPositions[0].magnitude() - touchPositions[1].magnitude());

        if(this._pinchPreviousDistance < 0){
            this._pinchStartDistance = pinchCurrrentDifference;
            this._pinchPreviousDistance = pinchCurrrentDifference
            return;
        }

        if(pinchCurrrentDifference > this._pinchPreviousDistance)
            this._onPinchOut.dispatch(pinchCurrrentDifference - this._pinchStartDistance); //zoom in

        if(pinchCurrrentDifference < this._pinchPreviousDistance)
            this._onPinchIn.dispatch(pinchCurrrentDifference - this._pinchStartDistance); // zoom out

        this._pinchPreviousDistance = pinchCurrrentDifference;
    }

    private createTouchDataObject(touchIdentifier: number, touch: Touch, eventType: string): TouchData{
        let screenPosition = new Vector2(touch.screenX, touch.screenY);
        let clientPosition = new Vector2(touch.clientX, touch.clientY);
        let pagePosition = new Vector2(touch.pageX, touch.pageY);
        let dataObject: TouchData = new TouchData(touchIdentifier, screenPosition, clientPosition, pagePosition, touch.radiusX, touch.radiusY, eventType);

        return dataObject;
    }

    private dispatchIfFirstTouch(dataObject: TouchData): void{
        if(this._firstTouch){
            this._firstTouch = false;
            this._onFirstTouch.dispatch(dataObject);
        }
    }

    private dispatchIfLastTouch(dataObject: TouchData): void{
        if(this._touches.size == 0){ 
            this._onLastTouch.dispatch(dataObject);
            this._firstTouch = true;
        }
    }

